import { Link } from 'react-router-dom';

const LinkArray = [
    
    {path: '/', label: 'Home', id: '1'},
    {path: '/about', label: 'About', id: '2'},
    {path: '/product', label: 'Product', id: '3'}
    
    // <Link to='/' > Home</Link >,
    // <Link to='/about'>About</Link>,
    // <Link to='/product'>Product</Link>
]

export default LinkArray;
